import React from "react";
import Head from "next/head";

import Navbar from "./Navbar";
import Footer from "./Footer";

const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>LHM | High Quality Soap</title>
      </Head>
      <div className="wrapper">
        <Navbar />
        {props.children}
        <Footer />
      </div>

      <style jsx>{`
        .wrapper {
          min-height: 100%;
          display: flex;
        }
      `}</style>
    </div>
  );
};

export default Layout;
